import React, { Component } from 'react';
import { Bar, Pie, Line } from 'react-chartjs-2';

class Chart extends Component {
    constructor() {
        super(props);
        this.state = {
            chartData: {
                labels: ['Test1', "Test2"],
                datasets:[
                    {
                        label: 'Population',
                        data: [200, 300]
                    }
                ],
                backgroundColor: [
                    'rgba(255, 99, 132, 0.6)',
                    'rgba(54, 162, 235, 0.6)',
                ]
            }
        }
    }
    render() {
        return (
            <div>
                <Bar
                data={this.state.Chartdata}
                options={{ maintainAspectRatio: false }}
                />
            </div>
        )
    }
}

export default Chart;
